const {picture, value, label} = item



    return (
    <Container className="card" style={{marginTop:"10px"}}>
      <Row key={index} style={{paddingTop:"10px"}}>
        <Col md="4">
          <img src={picture}>
          </img>
        </Col>
        <Col md="4">
          {label}
        </Col>
        <Col md="4">
          <Button color="primary" onClick={() => editPersonalia(index)}>Edit</Button>
          <Button color="danger" onClick={() => deletePersonalia(index)} style={{marginLeft:"5px"}}>Delete</Button>
        </Col>
      </Row>
    </Container>
  );
}

export default List;
